        //打开服务器
        this._server.listen({ port, host }, this.startup.bind(this));
    }
    /**
     * 服务器启动完成
     * @returns 返回服务器消息协议的类型
     */
    startup() { return Application.ProtocolType.JSON; }
    /**
     * 发生客户端连接服务器时的回调
     * @param socketClient 连接服务器的客户端
     */
    onConnect(socketClient) { }
    /**服务器关闭时的回调 */
    onClose() { }
    onHeaders(headers, request) { }
    /**
     * 服务器发生错误时的回调
     * @param error 错误信息
     */
    onError(error) { }
}
