    let ProtocolType;
    (function (ProtocolType) {
        /**JSON字符串类型 */
        ProtocolType[ProtocolType["JSON"] = 0] = "JSON";
        /**普通二进制类型 */
        ProtocolType[ProtocolType["ARRAY_BUFFER"] = 1] = "ARRAY_BUFFER";
