            result.pop();
            result.pop();
            result.pop();
            rootPath = result.join("/");
        }
        else if (p === "win32") {
            const result = __dirname.split("\\");
            //目录只保留从根目录到dist的目录
            result.pop();
            result.pop();
            result.pop();
            rootPath = result.join("\\");
        }
        return rootPath;
