        if (typeof data === "string") {
            if (data === "no-threadFile") {
                Debug.error("线程异常终止，原因是找不到相应的执行脚本！");
            }
        }
        else {
            if (this._runningTasks.has(data.id)) {
                const task = this._runningTasks.get(data.id);
                task.execute(data.args);
                Debug.log(`任务${task.name}执行完毕！`);
